import React from 'react';

function ProjectSlide({ image, title, description }) {
    return (
        <div>
            <img src={image} alt="" className="img-fluid" />
            <h3>{title}</h3>
            <p>{description}</p>
        </div>
    );
}

export default ProjectSlide;
